import ptz from "./ptz.svg";
import "./App.css";

export function App() {
	return <div className="App">{urlInput()}</div>;
}

// Define function for PTZ Logo
function ptzHeader() {
	<header className="App-header">
		<img src={ptz} className="App-logo" alt="PUTZ Logo" />
	</header>;
}

// Define text input for links
function urlInput() {
	return (
		<div className="Song-Input">
			<input
				className="URL-Input-Group"
				name="SoundCloud URL Input"
				placeholder="Enter SoundCloud URL..."
			/>
		</div>
	);
}

export default App;
